export default function Testimonials() {
    return (
        <div className="testimonials" id="testimonials">
            <h1>Testemonials</h1>
            <div className="container">
                <div className="card">
                    <div className="top"></div>
                    <div className="center"></div>
                    <div className="bottom"></div>
                </div>
            </div>
        </div>
    )
}
